import React from "react";
import ReactDOM from 'react-dom';

ReactDOM.render(
  <>
  <input type="checkbox" onChange={(e) =>{
    (e.target.value)
  }} /><span>Uppercase</span>
  <input type="checkbox" onChange={(e) =>{
    (e.target.value)
  }} /><span>lowercase</span>
  <input type="checkbox" onChange={(e) =>{
    (e.target.value)
  }} /><span>number</span>
  <input type="checkbox" onChange={(e) =>{
    (e.target.value)
  }} /><span>symbol</span>
  </>, document.getElementById('root')
)
